import React from 'react';
import logo from '../assets/logo-jp.png';

export default function UnderConstruction() {

    return(
        <>
            <div className="App">
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
                    <p>Strona w przygotowaniu</p>
                </header>
            </div>
        </>
    )
}
